column5:
Allow more succinct `Requires`

It's bugged me for a long time that I can't list my claims out like so:

    this.RequiresClaims("Claim One", "Claim Two");
    this.RequiresAnyClaim("Claim One", "Claim Two");

If this gets merged in I *will* be able to do that.

Adds WriteAttributeTo method

The following was throwing an exception that WriteAttributeTo did not exist

```csharp
@helper test(string className)
{
    <p class="@className"></p>
}
```

The `WriteAttributeTo` method was missing from the `NancyRazorViewBase`

Added support for Context in SSVE

You can now access the context by using @Context and it works the
same way as @Model. In addition the conditional @If and @IfNot
as well as the @Each operator now supports that you deine the
model source using

  @If.Model...
  @IfNot.Model...
  @If.Context...
  @IfNot.Context...
  @Each.Model...
  @Each.Context...

If the model source is not included it will default to use the model
as the source.

Support for optional parameters

Parameters can now be turned optional using the following syntax
{foo?} and they can have default values {foo?bar}

Updated AntiForgeryToken code

Will now only attempt to create a token if there is a valid
@AntiForgeryToken; match in the SSVE view

Flipped a couple of public fields to private

The engine and renderContext fields on HtmlHelper<TModel> were set to
public. Big boo boo =)

Added @Model substitution to SSVE

There was a regex limitation for single substitutions that prevented
@Model subsitution for primitive model types.
